import React from "react";
import "./Navigation.css";

const Navigation = () => {
	return (
		<div>
			<nav>
				<p className="f3 link dim black underline pa3 pointer">Sign Out</p>
			</nav>
			<div className="title white">{"smartbrain"}</div>
		</div>
	);
};

export default Navigation;
